import React from "react";

function Nav() {
  const categories = [
    {
      name: "About Me", //this is the name of the link
      label: "About", //this is the label that will be displayed in the navbar
    },
    {
      name: "Portfolio",
      label: "Portfolio",
    },
    {
      name: "Contact",
      label: "Contact",
    },
    {
      name: "Resume",
      label: "Resume",
    },
  ];

  function categorySelected() {
    console.log("category selected");
  }

  return (
    <ul className="flex-row">
      {categories.map((category) => (
        <li className="mx-2" key={category.name}>
          <span onClick={() => categorySelected(category.name)}>
            {category.name}
          </span>
        </li>
      ))}
    </ul>
  );
}

export default Nav;
